import { useContext } from "react";
import { Button, Container, Nav, NavDropdown } from "react-bootstrap";
import Navbar from "react-bootstrap/Navbar";
import { NavLink } from "react-router-dom";
import auth from "../../class/Auth/Auth";
import { SiteContext } from "../../context";





interface NavBarProps {
}

const NavBar = ({ }: NavBarProps) => {
    const check:boolean = auth.Auth();
    const { userType, setUserType } = useContext(SiteContext);
    console.log(check);
    return (
        <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
            <Container>
                <Navbar.Brand href="#home">IT Project Comparison</Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                    <Nav className="me-auto">
                        {check?
                        <>
                           <Nav.Link as={NavLink} to="/login">login</Nav.Link>
                        <Nav.Link as={NavLink} to="/companies">Companies</Nav.Link>
                        <Nav.Link as={NavLink} to="/contact">Contact</Nav.Link>
                          
                        </>
                    
                        : 
                        <>
                         <Nav.Link as={NavLink} to="/home">Home</Nav.Link>
                    
                          <Nav.Link as={NavLink} to="/register">Registeren</Nav.Link>
                        </>
                        
                        }
                      
                    </Nav>
                </Navbar.Collapse>
                <Nav.Item className="ml-auto">
                    {userType == "expert" ?
                     <Button onClick={() => { setUserType("beginner")}}>Expert</Button>
                     :
                     <Button onClick={() => { setUserType("expert")}}>Beginner</Button>
                    }
                </Nav.Item>
            </Container>
        </Navbar>
    )
}

export default NavBar;
